/* ONE light UI variables
** ---------------------------------------------- */
/* Official variables
** These variables must be defined in every theme
** Source: https://github.com/atom/atom/blob/master/static/variables/ui-variables.less
** ---------------------------------------------- */
/* Custom variables
** These variables are only used in this theme
** ---------------------------------------------- */
html {
  font-size: 11px;
}
/* Packages variables
** These variables are used to override packages
** ---------------------------------------------- */
/* Debug
** Output variables to the top of the UI
** ------------------------------------- */
.tree-view-resizer {
  position: relative;
  height: 100%;
  overflow: hidden;
  cursor: default;
  -webkit-user-select: none;
  min-width: 100px;
  width: 200px;
  z-index: 2;
}
.tree-view-resizer .tree-view-resize-handle {
  position: absolute;
  top: 0;
  bottom: 0;
  width: 10px;
  cursor: col-resize;
  z-index: 3;
}
.tree-view-resizer[data-show-on-right-side='true'] .tree-view-resize-handle {
  left: -5px;
}
.tree-view-resizer[data-show-on-right-side='false'] .tree-view-resize-handle {
  right: -5px;
}
.tree-view-scroller {
  height: 100%;
  width: 100%;
  overflow: auto;
}
.tree-view {
  min-width: -webkit-min-content;
  min-height: 100%;
  padding-left: 0.45454545em;
  padding-right: 1.5em;
  position: relative;
}
.tree-view .entry:before {
  content: '';
  position: absolute;
}
.platform-win32 .tree-view-resizer .tree-view-resize-handle {
  cursor: ew-resize;
}
